import React, { useState } from 'react';




const App=()=>{


const [count,setCount]=useState();



const InClick=()=>{
    setCount(100);
    // console.log('clicked'+ count++);
};





return(
    <>
        <h1>{count}</h1>
        <button onClick={InClick}>Click Me</button>
    </>
)

}
export default App;
